function vectorize(a){a.is_vector=true;var b=0.000001;a.equals=function(c){var e=true;if(this.length!=c.length){e=false}else{for(var d=0;d<this.length;d++){if(Math.abs(this[d]-c[d])>b){e=false}}}return e};a.add=function(c){for(var d=0;d<this.length;d++){this[d]+=c[d]}return this};a.subtract=function(c){for(var d=0;d<this.length;d++){this[d]-=c[d]}return this};a.unit=function(c){return this.divide(this.abs())};a.abs=function(){var d=0;for(var c=0;c<this.length;c++){d+=this[c]*this[c]}return Math.sqrt(d)};a.multiply=function(c){if(typeof(c)==typeof(1)){for(var d=0;d<this.length;d++){this[d]*=c}}return this};a.divide=function(c){if(typeof(c)==typeof(1)){for(var d=0;d<this.length;d++){this[d]/=c}}return this};a.dot=function(c){var e=0;for(var d=0;d<this.length;d++){e+=this[d]*c[d]}return e};return a};